import React from 'react'

function User() {
  return (
    <div>
      <h2>Users</h2>
      {users.map((user) => (
        <div key={user.id}>
          <input
            type="checkbox"
            value={user.id}
            checked={selectedUsers.includes(user.id)} // Check if user is selected
            onChange={() => onUserFilterChange(user.id)} // Handle user filter change
          />
          {user.name}
        </div>
      ))}
    </div>
  )
}

export default User
